void* get_Monster_vtable_(){
  if(Monster_vtable_ptr== NULL){
    struct Monster_vtable temp = 
      {
      };
    memcpy(&Monster_vtable_, &temp, sizeof(temp));
    int equal = (int)memcmp(&Monster_vtable_, &temp, sizeof(temp));
    if(equal != 0){
      printf("Memory copy error: buffer polluted\n");
      exit(-2);
    }
    Monster_vtable_ptr = &Monster_vtable_;
  }
  return (void*)(Monster_vtable_ptr);
}

